export default {
    name: "ResponseCard",
    props: {
        responseArray: [],
        title: String
    },


    computed: {
        responseString () {
            let returnString = ''
            for(let i = 0; i < this.responseArray.length; i++){
                let myResponse = this.responseArray[i];

                returnString += myResponse + '\n';
            }

            return returnString;
        }
    }
}
